import React, { Component } from "react";

import { Dashboard as DashboardLayout } from "layouts";
import { APTITUDE } from "../../constants";
import style from "./style.module.css";
// styles
import styles from "./styles";
import { withStyles } from "@material-ui/styles";
import { Typography } from "@material-ui/core";

class CoreSubjects extends Component {
  constructor(props) {
    super(props);

    this.state = {
      questions: [
        {
          question: "what is pointer",
          a: "refernce",
          b: "object",
          c: "varaible",
          d: "constant",
          correct: "refernce",
          isCorret: "NA"
        },
        {
          question: "what is pointer",
          a: "refernce",
          b: "object",
          c: "varaible",
          d: "constant",
          correct: "refernce",
          isCorret: "NA"
        }
      ]
    };
  }

  render() {
    const { classes } = this.props;
    return (
      <DashboardLayout mode={APTITUDE} title="Core Subjects">
        <div className={classes.root}>
          {this.state.questions.forEach(ques => {
            return (
              <div>
                <Typography>{ques.question}</Typography>
                <Typography>{ques.a}</Typography>
                <Typography>{ques.b}</Typography>
                <Typography>{ques.c}</Typography>
                <Typography>{ques.d}</Typography>
                <Typography>{ques.correct}</Typography>
                <Typography>{ques.isCorret}</Typography>
              </div>
            );
          })}
        </div>
      </DashboardLayout>
    );
  }
}

export default withStyles(styles)(CoreSubjects);
